content:
La CAQ s’était rallié à la dernière heure à ce tramway à trois conditions:
1- le tramway devait desservir les banlieues;
2- il devait y avoir une interconnexion avec la Rive-Sud;
3- le budget devait être respecté, sans dépassement de coûts.

renderedContent:
La CAQ s’était rallié à la dernière heure à ce tramway à trois conditions:
1- le tramway devait desservir les banlieues;
2- il devait y avoir une interconnexion avec la Rive-Sud;
3- le budget devait être respecté, sans dépassement de coûts.

